func findLength(nums1 []int, nums2 []int) int {
	dp := make([][]int, len(nums1)+1)
	res := 0
	t := 0
	dp[0] = make([]int, len(nums2)+1)
	for i := 0; i < len(nums1); i++ {
		dp[i+1] = make([]int, len(nums2)+1)
		nx := i + 1
		for j := 0; j < len(nums2); j++ {
			if nums1[i] == nums2[j] {
				t = dp[i][j] + 1
				dp[nx][j+1] = t
				if t > res {
					res = t
				}
			}
		}
	}
	return res
}

